import React,{useState,useEffect} from 'react'
import Axios from 'axios'
import {useHistory} from 'react-router-dom'
import TermName from '../components/TermName';

export default function Home() {

    const [termList,setTermList] = useState([]);

let history = useHistory();

useEffect(()=>{
Axios.get('https://the-dicktionary.herokuapp.com/api/distinctname').then((data)=>{
    console.log(data)
    setTermList(data.data)
}).catch(err => console.log(err))
},[])


    return (
        <>
            <div className='form_page_general'>
               <TermName height = "100px" width = "100px" radius = "50%" children = "nameedjdjdjjdss"></TermName>
            {termList.map(txt => 
            <p>{txt}</p>
            )}
            </div>
        </>
    );
}
